import React from "react";
import {NavLink} from 'react-router-dom';

const Menu = () =>{

    return(
        <>
            <NavLink exact activeClassName='active_class' to= '/home' >Home</NavLink>
            <NavLink exact activeClassName='active_class' to= '/todolist' >Todolist</NavLink>
            <NavLink exact activeClassName='active_class' to='/acordion'  >Accordion</NavLink>
        </>
    )
}

export default Menu;
